import { useState } from "react";
import "./styles/App.css";

function App() {
  const [track, setTrack] = useState([
    {
      name: "Listen Up",
      artist: "Oasis",
      album: "The Masterplan",
      id: Date.now(),
    },
  ]);

  console.log(track);
}

export default App;
